import React from "react";
import './contactus.css';
import { Dropdown, DropdownButton } from 'react-bootstrap';


const handleDropdownSelect = (eventKey) => {
    // Handle the dropdown select event here
    console.log('Selected option:', eventKey);
  };
  
const Contactus = () =>{
    return(
      <div className="container">
        <div className="contactus_title">
            <span style={{justifyContent:"center",display:"flex",color:"#fff",fontSize:"60px",fontWeight:"800"}}>Contact <span style={{fontWeight:"300"}}> &nbsp;Us</span></span>
        </div>
        <div className="contactus_form" style={{color:"#fff"}}>
            <input className="forminput names"
            placeholder="Full Name" style={{color:"#fff"}}/>
            <input  className="forminput phone"
            placeholder="Phone Number"/>
            <input  className="forminput email"
            placeholder="Email Address"/>
            <button  className="forminput dropdown">
            <Dropdown.Item eventKey="option1">Option 1</Dropdown.Item>
                   <Dropdown.Item eventKey="option2">Option 2</Dropdown.Item>
                   <Dropdown.Item eventKey="option3">Option 3</Dropdown.Item> 
             </button>

        




            <input  className="forminput message"
            placeholder="Your Message"/>
            <div className="button_div">
            <button className="submit_button btn mx-auto col-lg-6" ><span >Get a quote</span></button>
            </div>
        </div>
      </div>

    )
}
export default Contactus;
